            Console.WriteLine(e.Message);
        }
    }
    private async Task HandleDelete()
    {
        try
        {
            string url = "https://super-mini-market.herokuapp.com/api/Borrar_Producto/" + productos.IdProducto;
            Editable = consume.Get(url);
            if (Editable != null)
